DROP TABLE IF EXISTS `activity`;
CREATE TABLE `activity` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(100) NOT NULL COMMENT '演出名称',
  `show_start_time` datetime NOT NULL COMMENT '演出起始时间',
  `show_end_time` datetime NOT NULL COMMENT '演出结束时间',
  `venue_city` varchar(50) NOT NULL COMMENT '场地城市',
  `venue_name` varchar(100) NOT NULL,
  `venue_address` varchar(100) NOT NULL,
  `poster_image` varchar(255) NOT NULL COMMENT '海报图片',
  `source_channel` varchar(20) NOT NULL DEFAULT '' COMMENT '数据来源渠道（秀动：SHOWSTART）',
  `source_id` varchar(50) NOT NULL DEFAULT '' COMMENT '数据来源渠道-对象id',
  `source_url` varchar(255) NOT NULL DEFAULT '' COMMENT '来源url',
  `online` int(11) NOT NULL DEFAULT '0' COMMENT '线上活动',
  `artist_id` bigint(20) NOT NULL COMMENT '演出者id',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=148 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='演出表';

