-- ----------------------------
--  Table structure for `artist`
-- ----------------------------
DROP TABLE IF EXISTS `artist`;
CREATE TABLE `artist` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(50) NOT NULL COMMENT '姓名',
  `mp_weixin_app_id` varchar(255) NOT NULL DEFAULT '' COMMENT '微信小程序appId',
  `mp_weixin_app_secret` varchar(255) NOT NULL DEFAULT '' COMMENT '微信小程序appSecret',
  `mp_qq_app_id` varchar(255) NOT NULL DEFAULT '' COMMENT 'QQ小程序appId',
  `mp_qq_app_secret` varchar(255) NOT NULL DEFAULT '' COMMENT 'QQ小程序appSecret',
  `random_key` varchar(255) NOT NULL,
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=86644 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='演出者表';

