-- ----------------------------
--  Table structure for `collect_relation`
-- ----------------------------
DROP TABLE IF EXISTS `collect_relation`;
CREATE TABLE `collect_relation` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `target_type` varchar(10) NOT NULL COMMENT '目标类型（VIDEO：视频）',
  `target_id` bigint(20) NOT NULL COMMENT '目标id',
  `artist_id` bigint(20) NOT NULL COMMENT '演出者id',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_user_id` (`user_id`,`target_type`,`target_id`,`artist_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='关注-关联表';

