DROP TABLE IF EXISTS `moment_video`;
CREATE TABLE `moment_video` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `moment_id` bigint(20) NOT NULL COMMENT '动态id',
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT '视频标题',
  `url` varchar(255) NOT NULL COMMENT '图片地址',
  `width` int(11) NOT NULL DEFAULT '0' COMMENT '视频宽',
  `height` int(11) NOT NULL DEFAULT '0' COMMENT '视频高',
  `size` int(11) NOT NULL DEFAULT '0' COMMENT '视频大小',
  `cover_url` varchar(255) NOT NULL DEFAULT '' COMMENT '封面url',
  `cover_width` int(11) NOT NULL DEFAULT '0' COMMENT '封面宽',
  `cover_height` int(11) NOT NULL DEFAULT '0' COMMENT '封面高',
  `collect_count` int(11) NOT NULL DEFAULT '0' COMMENT '收藏数量',
  `source_channel` varchar(30) NOT NULL DEFAULT '' COMMENT '来源渠道',
  `source_url` varchar(1000) NOT NULL DEFAULT '' COMMENT '来源url',
  `source_id` varchar(100) NOT NULL DEFAULT '' COMMENT '来源id',
  `sequence` bigint(20) NOT NULL DEFAULT '0' COMMENT '排序字段',
  `artist_id` bigint(20) NOT NULL COMMENT '演出者id',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_moment_id` (`moment_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='动态-视频表';

