-- ----------------------------
--  Table structure for `notification`
-- ----------------------------
DROP TABLE IF EXISTS `notification`;
CREATE TABLE `notification` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `category` varchar(20) NOT NULL COMMENT '通知类型',
  `type` varchar(50) NOT NULL COMMENT '通知类型',
  `receive_user_id` bigint(20) NOT NULL COMMENT '接收通知的用户id',
  `send_user_id` bigint(20) NOT NULL COMMENT '发通知的用户id',
  `moment_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '动态id',
  `parent_comment_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '父评论id',
  `comment_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '评论id',
  `artist_id` bigint(20) NOT NULL COMMENT '演出者id',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='通知表';

