-- ----------------------------
--  Table structure for `private_letter`
-- ----------------------------
DROP TABLE IF EXISTS `private_letter`;
CREATE TABLE `private_letter` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `sender_user_id` bigint(20) NOT NULL COMMENT '发送者id',
  `receiver_user_id` bigint(20) NOT NULL COMMENT '接收者id',
  `type` int(11) NOT NULL COMMENT '类型（0：纯文本，1：图片）',
  `text_content` varchar(255) NOT NULL DEFAULT '' COMMENT '文本内容',
  `image_url` varchar(255) NOT NULL DEFAULT '' COMMENT '图片链接',
  `artist_id` bigint(20) NOT NULL COMMENT '演出者id',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='私信表';

