-- ----------------------------
--  Table structure for `user`
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(50) NOT NULL COMMENT '用户名',
  `gender` int(11) NOT NULL DEFAULT '1' COMMENT '性别（0：女，1：男）',
  `avatar_url` varchar(255) NOT NULL DEFAULT '' COMMENT '头像url',
  `description` varchar(50) NOT NULL DEFAULT '' COMMENT '个人简介',
  `mini_weixin_union_id` varchar(255) NOT NULL DEFAULT '' COMMENT '微信小程序unionId',
  `mini_weixin_open_id` varchar(255) NOT NULL DEFAULT '' COMMENT '微信小程序openId',
