  `follow_count` int(11) NOT NULL DEFAULT '0' COMMENT '关注人数',
  `fans_count` int(11) NOT NULL DEFAULT '0' COMMENT '粉丝人数',
  `letter_unread` int(11) NOT NULL DEFAULT '0' COMMENT '私信未读',
